import React from 'react'
import { Form } from 'semantic-ui-react'
import ValidationSignUpCompany from "./ValidationSignUpCompany"

function SignUpFormCompany(){
   
  const {handleChange, values} = ValidationSignUpCompany();

  return (
    <Form>
      <Form.Input fluid id="company_name" label='Company Name' placeholder='Name' value={values.company_name} onChange={handleChange}/>
      <Form.Input fluid id="email" type="email" label='Company Email' placeholder='Email' value={values.email} onChange={handleChange}/>
      <Form.Input fluid id="pass" label='Enter Password' type='password' value={values.pass} onChange={handleChange}/>
      <Form.Input fluid id="confirm_pass" label='Confirm Password' type='password' value={values.confirm_pass} onChange={handleChange}/>
      <Form.Button>Submit</Form.Button>
    </Form>
  );
}

export default SignUpFormCompany;
